import React from "react";
import Head from "next/head";
import Logo from "../../public/Logo.svg";
export default function Home() {
  return (
    <React.Fragment>
      <Head>
        <title>Home | Tom Blankenship</title>
      </Head>
      <div style={{ width: 200 }}>
        <Logo />
      </div>
    </React.Fragment>
  );
}
